"use strict";

const URL = require("../config/urls");
class AuditResource {
    constructor(options) {
      this.apiClient = options.apiClient;
    }
  
    // GET /api/v1/audits
    getAudits(callback) {
      return this.apiClient._getRequest(URL.AUDIT_RESOURCE, callback);
    }
  }
  
  module.exports = AuditResource;
  